import '../../styles/components/layout/Header.css';
import React from 'react';
const Header= (props)=>{
    return (
        <div classNa='holder'>
            <img scr="img/logo.jpg" width={100} alt="plantasyotrashierbas"/> 
            <h1>Plantas y Otras Hierbas</h1>

        </div>
    );
};



export default Header;
